import { useState } from "react"
import StoreList from "../components/StoreList"
import { generateStores } from "../helpers/fake-data-helper"
import { useDispatch } from "react-redux"
import { getAllShop } from "../store/actions/shop-action"
import { useEffect } from "react"

const DashboardGuest = () => {
  const [stores] = useState(generateStores())
  const [storeList, setStoreList] = useState([])
  const dispatch = useDispatch()

  const fetchAllShop = async () => {
    const response = await dispatch(getAllShop())
  }
  useEffect(() => {
    setStoreList(fetchAllShop)
  }, [fetchAllShop])

  console.log(storeList)
  return (
    <>
      <div className="store-search"></div>
      <div className="store-list">
        {stores && <StoreList stores={stores}></StoreList>}
      </div>
    </>
  )
}

export default DashboardGuest
